(3, 'Koolooly', '16011376909', 'gregorMuth@gmail.com', 'We offer you the opportunity to advertise your products and services. \r\n \r\nCiao! Behold is  an important offers for you. I can help you with sending  your commercial offers or messages through feedback forms. The advantage of this method is that the messages sent through the feedback forms are included in the white list. This method increases the chance that your message will be read. The same way you received this message. \r\nSending via Feedback Forms to any domain zones of the world. (more than 1000 domain zones.). \r\nThe cost of sending 1 million messages for any domain zone of the world is $ 49 instead of $ 99. \r\nDomain zone .com - (12 million messages sent) - $399 instead of $699 \r\nAll domain zones in Europe- (8 million messages sent) - $ 299 instead of $599 \r\nAll sites in the world (25 million messages sent) - $499 instead of $999 \r\nDomain zone .de - (2 million messages sent) - $99 instead of $199 \r\nDomain zone .uk - (1.5 million messages sent) - $69 instead of $139 \r\nDomain zone .nl - (700 000 sent messages) - $39 instead of $79 \r\n \r\n \r\nDiscounts are valid until March 25. \r\n \r\nContact us. \r\nTelegram - @FeedbackFormEU \r\nSkype – FeedbackForm2019 \r\nEmail - FeedbackForm2019@gmail.com \r\n \r\nBest wishes', '2019-03-20 07:10:30', '2019-03-20 07:10:30'),
(4, 'PrestonboB', '114777477', 'savemoney@takecreditcardsfree.com', 'Hello I was wanting to see, if you wanted to stop paying fees to accept credit cards? I am with http://www.TakeCreditCardsFree.com and with us, you can take every type of credit card, you get your money deposited within 2 business days and you pay 0% plus $0.00 per transaction, the only thing you pay is a $25 per month account fee, and then you just use your existing terminal, or buy/lease one from us. What’s the catch? The catch is, instead of charging you, your customer is charged a small convenience fee via the credit card machine we send you,  of just 40 cents per every $10 to which the customer is spending and that’s it. Would you be interested in this? If so go to our website or call/text us at 720-791-3210 or go to our website http://www.takecreditcardsfree.com', '2019-03-25 18:06:01', '2019-03-25 18:06:01'),
(5, 'RobertThype', '118315162', 'instaresultsteam@gmail.com', 'Hi there, \r\n \r\nI came across your website and wanted to get in touch. \r\n \r\nI run an Instagram Growth Service helping thousands of clients to grow their Instagram significantly with REAL and RELEVANT followers, through organic marketing techniques. \r\n \r\nYou can learn more about how our service works here: \r\nhttp://bit.ly/instagram-results - interesting right? \r\n \r\nI wanted to reach out to hear if our Instagram Growth Service could be of any interest to you? \r\n \r\nNote, we are NOT selling fake followers and advise you to never buy fake followers as it doesn’t bring any real value to your business. What we are doing is a consistent, authentic approach to interacting with real people who are in your target audience to get their attention and drive them to your page. \r\n \r\nThe results that our clients see are typically: \r\n10,000 new monthly impressions \r\n400-1500 new, real and targeted followers per month \r\nIncreased engagement, website traffic & sales. \r\n \r\nThe pricing for our service is only $67/mo and we offer a 30-day money back guarantee for the first month to let you try it without any risk. \r\n \r\nIf you’re ready to boost your Instagram results risk-free, you can sign up here to get started: \r\nhttp://bit.ly/instagram-signup - It’s 100% safe & secure. \r\n \r\nIf this is not for you, no problem at all and thank you for your attention. \r\n \r\nIf you’re interested in learning more, please contact us on the email below: \r\nEmail: instaforce5@gmail.com', '2019-03-25 22:58:08', '2019-03-25 22:58:08'),
